<div class="complete" id="complete">

  <div class="frame-parent">

    <div class="project-parent">

      <div class="project" *ngFor="let project of CompleteProjects" id="{{project.name}}">
        <a 
        (click)="NavToProject(project.route)"
        [routerLink] = "project.route">
          <app-project [project]="project"></app-project>
        </a>
      </div>

    </div>
    
  </div>

  <div class="h2">
    <div class="live">#</div>
    <div class="small-projects">complete-apps</div>
  </div>
</div>
